import React from 'react';

const DangerButton = ({ text, onClick }) => (
	<button
		onClick={onClick}
		className="text-red-600 text-sm rounded border border-red-600 px-2 hover:text-white hover:bg-red-600"
	>
		{text}
	</button>
);

export default DangerButton;
